import React from 'react';
import './App.css';
import VideoCard from './VideoCard';

function App() {
  return (
    <div className="app">
      <h1>Let's begin!</h1>

      <div className="app__top">
      {/* image at the top */}
      <img
        className="app__log"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_2016.svg/768px-Instagram_logo_2016.svg.png"
        alt=""
        />
        <h1>Reels</h1>
      {/* Reels text */}
      </div>

      <div className="app__videos">

      {/* container of app__video(scroll) */}
      <VideoCard 
      channel={channel}
      avatarSrc={avatarSrc}
      song={song}
      url={url}
      likes={likes}
      shares={shares} />
      <VideoCard />
      <VideoCard />
      <VideoCard />
      {/* video */}
      </div>
    </div>
  );
}

export default App;
